clc; clear; close all;
filename = 'my_workspace.mat';
load(filename);
%%

soundsc(anechoic_rcv_noisy(:,1:num_play_samples)',fs)
%%
soundsc(source_signals(:,1:num_play_samples)',)
%%
% Mic 1 receives signal + noise
mic1 = anechoic_rcv_noisy(1,:);mic2 = anechoic_rcv_noisy(2,:)

%%
%% 1. Define the Microphone Array Geometry
% Assuming a simple Uniform Linear Array (ULA)
numElements = 2;
elementSpacing = 0.08; % 5cm spacing (adjust based on your setup)
array = phased.ULA(numElements, elementSpacing);

% Define the operating frequency (e.g., center frequency of human speech)
fs = 16000; % Sample rate from your recording
f_center = 1000; % 1 kHz
c = 343; % Speed of sound in m/s

%% 2. Create the Conventional Beamformer (Delay-and-Sum)
% This points the "focus" of the mics toward a specific angle
targetAngle = 0; % Degrees (Broadside)
beamformer = phased.PhaseShiftBeamformer('SensorArray', array, ...
    'OperatingFrequency', f_center, 'PropagationSpeed', c, ...
    'Direction', target_angles');

%% 3. Visualize the Beampattern
% This shows the sensitivity of your two mics across 180 degrees
figure; %[output:5245e324]
pattern(array, f_center, -180:180, 0, 'PropagationSpeed', c, ... %[output:5245e324]
    'CoordinateSystem', 'polar', 'Type', 'directivity'); %[output:5245e324]
title(['Beampattern for 2-Element Array at ', num2str(f_center), ' Hz']); %[output:5245e324]

%% 4. Apply Beamforming to your Signal
% Concatenate your mic signals into a matrix [Time x Channels]
inputSignal = [mic1(:), mic2(:)]; 

% Apply the beamformer
beamformedSignal = beamformer(inputSignal);

%% 5. Compare Results
figure; %[output:6a6da39f]
subplot(2,1,1); %[output:6a6da39f]
plot(mic1); title('Original Signal (Mic 1)'); grid on; %[output:6a6da39f]
subplot(2,1,2); %[output:6a6da39f]
plot(beamformedSignal); title('Beamformed Signal (Focused at 0Â°)'); grid on; %[output:6a6da39f]

